import React from "react";
import "./App.css";

function App() {
  const user = {
    username: "JohnDoe",
    trophies: 1250
  };

  // Mock leaderboard data
  const global = [
    { rank: 1, name: "Alice", trophies: 3000, organization: "Org A" },
    { rank: 2, name: "Bob", trophies: 2700, organization: "Org B" },
    { rank: 3, name: "Charlie", trophies: 2500, organization: "Org C" }
  ];

  // Mock organization table
  const organization = [
    { rank: 1, name: "Daniel", trophies: 2000, organization: "Org X" },
    { rank: 2, name: "Eve", trophies: 1800, organization: "Org X" },
    { rank: 3, name: "Frank", trophies: 1500, organization: "Org X" }
  ];

  // Mock friends table
  const friends = [
    { rank: 1, name: "George", trophies: 900, organization: "Org Z" },
    { rank: 2, name: "Hannah", trophies: 850, organization: "Org Y" },
    { rank: 3, name: "Ian", trophies: 800, organization: "Org W" }
  ];

  // Helper to generate tables
  const renderTable = (title, data) => (
    <div className="table-section">
      <h2 className="table-title">{title}</h2>

      <table className="custom-table">
        <thead>
          <tr>
            <th>Rank</th>
            <th>Name</th>
            <th>Trophies</th>
            <th>Organization</th>
          </tr>
        </thead>

        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              <td>{row.rank}</td>
              <td>{row.name}</td>
              <td>{row.trophies}</td>
              <td>{row.organization}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );

  return (
    <div className="page-container">

      {/* User bar at top-left */}
      <div className="user-bar">
        <span className="user-text">User: {user.username}</span>
        <span className="user-text">Trophies: {user.trophies}</span>
      </div>

      {/* All tables stacked vertically */}
      <div className="tables-wrapper">
        {renderTable("Global Leaderboard", global)}
        {renderTable("Organization", organization)}
        {renderTable("Friends", friends)}
      </div>

    </div>
  );
}

export default App;
